import React from 'react'
import { 
  Box, 
  Stack, 
  styled, 
  
} from '@mui/material'

import imgMen from '../assets/men.png';
import fundoAzul from '../assets/fundoAzul.png';




const Information = () => {


  
    return (
      
      <BoxRow 
      component = 'footer'
      sx={{
        py: 4,
        px: 2,
      }}
      >
        <StackColumn>
<Stack 
        direction='row' 
        width= '70px'
        maxWidth='100%'
        justifyContent='space-between'
        >
          
  
    <div class="container" >
    <img src={fundoAzul} alt="Homem Apontando" class="imagem-direita" style={{  width: '100%', height: 'auto', position:'fixed', }}/>
        <img src={imgMen} alt="Homem Apontando" class="imagem-direita" style={{ position: 'relative', width: '900%' ,left: '400px' }}/>
  
    </div>


        </Stack>
        </StackColumn>
      </BoxRow>
    )
  }

  export default Information
